goals:
Chercheur dans le domaine des cellules souches pluripotentes induites « iPS » (projet de thèse de doctorat PhD) et praticien en secteur de PMA « 24 ans et plus » ;
Passionné par la biologie médicale, plus particulièrement la biologie de la reproduction et par les progrès de la procréation médicale et de la médecine régénératrice (biothérapie cellulaire et génique), mes études ont été centrées d’abord sur l’amélioration de la qualité en production par le :
 
      DESS « Assurance Qualité » que j’ai effectué à la faculté des sciences et techniques de  
      Tours.
 
Cette formation théorique demande un complément de connaissance, une amélioration du savoir faire et une mise à niveau et ce ci a été réalisé par le billet de :
 
      DU « Assistance Médicale à la Procréation » Faculté de Médecine de Montpellier ;
 
      DIU « Infertilité masculine et PMA » Facultés de médecine Toulouse / Montpellier ;
  
      DES Immunologie Approfondie, Faculté de Médecine et de Pharmacie de Rabat ;
 
      D.U Médecine Régénératrice : Thérapie Cellulaire et Génique, Facultés de Médecine de    
      Montpellier ;
 
      Doctorat PhD : Biologie médicale, pathologie humaine et expérimentale et 
      environnement, Faculté de Médecine et de Pharmacie de Rabat  (Encours).

Doté ainsi d'une quadruple formation scientifique, médicale, qualité et informatique, je recherche un poste de responsabilité et ce ci par le biais de cette formation « Désir d’entreprendre » organisé par France Université Numérique.
Par ailleurs, je suis persuadé que mes qualités relationnelles, ma rigueur et mon sens du service me permettront de bien réussir cette formation et de faire de notre collaboration une réussite partagée.

Espérant que mon profil satisfera les conditions requises pour cette formation, je vous prie de croire, en l'expression de mes respectueuses salutations.


									Abdelkrim SALAMA
